import react from 'react'

//import style
import contentFragmentStyles from './contentFragment.module.scss'

const ContentFragment = (props) => {
    return (
        <react.Fragment>
            <div className={contentFragmentStyles.fragmentHeading}>

            </div>
            {props.title}

            {props.time ? props.time : null}

            {props.text}

            <div>
                {/* children are just photos */}
                {props.children}
            </div>
        </react.Fragment>
    )
}

export default ContentFragment;
